 const Events = [
    {id:'ev1',title:'event1'},
    {id:'ev2',title:'event2'},
    {id:'ev3',title:'event3'},
]
export default function EventsPage(){
    return<><h1>Event</h1>
    <main>
    <ul>
        {Events.map((item)=><li key={item.id}><Link to={item.id}>{item.title}</Link></li>)}
    </ul>
    </main>
    </>
}
export {Events}
